import React from 'react'
import { Navbar,NavDropdown,Nav } from 'react-bootstrap';
const Footer = () => {
    return (
        <Navbar fixed='bottom'>
            <i>Copyright &copy; Podlivsky 2020</i>
            <i className="ml-auto">Facebook</i>
            <i className="ml-auto">Instagram</i>
        </Navbar>
    )
}

export default Footer
